import React from 'react';

const CommentDetail = ()=> {

    return (

        <div className="comment">
                <a href="/" className="avatar">
                    <img alt="avatar" src={Faker.image.avatar()}></img>
                </a>
                <div className="content">
                    <a href="/" className="author">
                        {Faker.name.findName()}
                    </a>
                    <div className="metadata">
                        <span className="date">
                            {Faker.date.weekday()}
                        </span>
                    </div>
                    <div className="text">
                        {Faker.lorem.sentence()}
                    </div>
                </div>
            </div>

    );

};
